@về
- I đg. 1 Di chuyển trở lại chỗ của mình, nơi ở, nơi quê hương của mình. Thầy giáo cho học sinh về chỗ. Tan học về nhà. Về thăm quê. Kiều bào về nước. 2 Di chuyển đến nơi mình có quan hệ gắn bó coi như nhà mình, quê hương mình, hoặc nơi mình được mọi người đối xử thân mật, coi như người nhà, người cùng quê. Lâu lắm tôi mới có dịp về thăm cụ. Về nhà bạn ăn Tết. Ông ta về công tác ở huyện này đã ba năm. Đại biểu các tỉnh về Hà Nội dự hội nghị. 3 (dùng phụ sau một đg. khác). Từ biểu thị hướng của hoạt động nhằm trở lại chỗ cũ hoặc nhằm đưa đến phía, nơi của bản thân mình. Bỏ chạy về. Quay trở về. Mua về lắm thứ. Lấy về. Rút tay về. 4 Di chuyển hoặc được vận chuyển đến đích cuối cùng. Xe ca đã về đến bến. Tàu này chạy về Vinh. Hàng chưa về, không có để bán cho khách. 5 Chết (lối nói kiêng tránh). Cụ đã về tối hôm qua. 6 (id.). Trở thành thuộc quyền sở hữu của người nào đó. Chính quyền về tay nhân dân. 7 (kết hợp hạn chế). Ở vào trong khoảng thời gian nào đó. Trời đã về chiều. Bệnh nhân hay sốt về sáng. Về mùa hè hay có dông. Từ nay về sau. Ba năm về trước. Về cuối. Về già.
- II k. 1 Từ biểu thị điều sắp nêu ra là phạm vi hay phương hướng của hoạt động, phạm vi của tính chất được nói đến. Bàn  vấn đề nông nghiệp. Nhìn về bên phải. Giỏi về toán. Về chuyện đó, còn có nhiều ý kiến. 2 (cũ, hoặc ph.). Vì. Người đẹp về lụa, lúa tốt về phân (tng.). Chết về bệnh lao.

